import React from 'react';
import arrow from '../../Images/Icons/Arrow 3.svg'
import './Button.css'

function Button() {
    return(
        <div className="Button_wrapper">
            <div className="footer">All tihg resevdd</div>
            <div className="Button_Text">Contact</div>
            <img src={arrow} alt="" />
        </div>
    )
}

export default Button;
